import React from 'react'
import Goals from './Goals'

export default function GoalContainer(props) {

    const renderGoals = props.goalArr.map((goals, index) => {
        return <Goals key={goals.id} name={goals.name} start_date={goals.start_date} end_date={goals.end_date} />
    })

    // console.log(props)
    return (
        <div>
            <br></br>

            <p>{props.categoryName}</p>
            <table>
                <tr>
                    <td>Goal</td>
                    <td>Start Date</td>
                    <td>End Date</td>
                 </tr>
                 <td>{renderGoals}</td>
            </table>

        </div>
    )
}
